package com.wsh.springboot.springbootfreemarker;

import freemarker.template.Configuration;
import freemarker.template.DefaultObjectWrapper;
import freemarker.template.Template;
import freemarker.template.TemplateExceptionHandler;
import org.springframework.web.bind.annotation.RequestMapping;
import org.springframework.web.bind.annotation.RestController;

import javax.servlet.http.HttpServletRequest;
import javax.servlet.http.HttpServletResponse;
import java.text.SimpleDateFormat;
import java.util.*;

/**
 * @Description: springboot集成freemarker导出word文件（包含图片）
 * @Author: weishihuai
 * @Date: 2019/2/24 08:40
 */
@RestController
public class TestController5 {


    // 处理下载word文档
    @RequestMapping("/download5")
    public void downloadWord(HttpServletRequest request, HttpServletResponse response) throws Exception {
        try {
            // 告诉浏览器用什么软件可以打开此文件
            response.setHeader("content-Type", "application/msword");
            // 下载文件的默认名称
            response.setHeader("Content-Disposition", "attachment;filename=违纪处分通知.doc");
            Map<String, Object> dataMap = this.getData();
            //创建配置实例对象
            Configuration configuration = new Configuration();
            //设置编码
            configuration.setDefaultEncoding("UTF-8");
            //加载需要装填的模板
            configuration.setClassForTemplateLoading(this.getClass(), "/");
            //设置对象包装器
            configuration.setObjectWrapper(new DefaultObjectWrapper());
            //设置异常处理器
            configuration.setTemplateExceptionHandler(TemplateExceptionHandler.IGNORE_HANDLER);
            //获取ftl模板对象
            Template template = configuration.getTemplate("test02.ftl", "UTF-8");
            //输出文档
            StringBuilder fileName = new StringBuilder("");
            String uuid = UUID.randomUUID().toString();
            SimpleDateFormat sdf1 = new SimpleDateFormat("yyyyMMdd");
            fileName.append(uuid).append("_").append(sdf1.format(new Date())).append("违纪处分").append(".doc");

            try {
                response.setContentType("application/octet-stream");
                response.setHeader("Content-Disposition", "attachment;filename="
                        + new String(fileName.toString().getBytes("GBK"), "ISO-8859-1"));
                response.setCharacterEncoding("utf-8");//处理乱码问题
                //生成Word文档
                template.process(dataMap, response.getWriter());
            } catch (Exception e) {
                e.printStackTrace();
            } finally {
                response.flushBuffer();
            }
        } catch (Exception e) {
            e.printStackTrace();
        }
    }

    private Map<String, Object> getData() {
        Map<String, Object> dataMap = new HashMap<>();
        SimpleDateFormat sdf = new SimpleDateFormat("yyyy-MM-dd");
        //基础数据
        dataMap.put("name", "weixiaohuai");
        dataMap.put("phone", "13800138000");
        dataMap.put("age", "20");
        dataMap.put("image", "");

        //表格数据
        List<Map<String, Object>> list = new ArrayList<>();
        for (int i = 0; i <= 9; i++) {
            Map<String, Object> userMap = new HashMap<>();
            userMap.put("name", "张三");
            userMap.put("phone", "13800138001");
            userMap.put("age", "20");
            userMap.put("image", "");
            list.add(userMap);
        }
        dataMap.put("list", list);
        return dataMap;
    }
}
